import React from 'react';
import styled from 'styled-components';

const Bar = styled.div`
    display: grid;
`

export default function() {
    return <Bar> 
        <div> Child 1 </div>
        <div> Child 2 </div>
        <div> Child 3 </div>
    </Bar>
}
